import 'bootstrap/dist/css/bootstrap.min.css';
import React from "react";
import {
  Card,
  Button,
  CardDeck
 } from 'react-bootstrap';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


export default function App() {
  return (
    <Router>
      <div>
      <Link to="/about">Home</Link>
        <nav>
        <CardDeck>
             <Card bg= 'dark' style={{ width: '18rem'  }}>
                  <Card.Img variant="top" src="" />
                  <Card.Body>
                    <Card.Title>Card Title</Card.Title>
                    <Card.Text>
                      Some quick example text to build on the card title and make up the bulk of
                      the card's content.
                    </Card.Text>
                    <Link to="/">Home</Link>
                    <Button variant="dark" ><Link to="/"/>Home</Button>
                  </Card.Body>
                </Card>
                <Card bg= 'dark' style={{ width: '18rem'  }}>
                  <Card.Img variant="top" src="" />
                  <Card.Body>
                    <Card.Title>Card Title</Card.Title>
                    <Card.Text>
                      Some quick example text to build on the card title and make up the bulk of
                      the card's content.
                    </Card.Text>
                    <Button variant="dark"><Link to="/about"/>About</Button>
                  </Card.Body>
                </Card>
                <Card bg= 'dark' style={{ width: '18rem'  }}>
                  <Card.Img variant="top" src="" />
                  <Card.Body>
                    <Card.Title>Card Title</Card.Title>
                    <Card.Text>
                      Some quick example text to build on the card title and make up the bulk of
                      the card's content.
                    </Card.Text>
                    <Button variant="dark"><Link to="/users"/>Users</Button>

                  </Card.Body>
                </Card>
          </CardDeck>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}
